    {ntt"total": 2,ntt"recent": 1nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-12-20T23:55:43.473809",nt"name": "mosaic-of-gridded-multibeam-bathymetry-and-bathymetry-derived-from-multispectral-world-view-2-s8b1d0",nt"isopen":
    false,nt"url": null,nt"notes": "Gridded multibeam bathymetry is integrated
    with bathymetry derived from multpectral World View-2 satellite data. Gridded (5
    m cell size) multibeam bathymetry collected aboard NOAA Ship Hiialaka'i and R/V
    AHI. Multibeam data were also collected aboard the NOAA Ship Oscar Elton Sette in
    2010, a 224? (68 m) United States National Oceanographic and Atmospheric Administration
    research ship. Bathymetry values shallower than ~20 m were derived by gauging the
    reletive attenuation of coastal, blue, green and yellow spectral radiance as a function
    of depth. A multiple linear regression analysis of coastal,blue, green and yellow
    band spectral values against depth determined the variables of y-intercept, coastal,blue,
    green and yellow slope values. Variables then used in multivariate slope intercept
    formula to derive depth. Digital image processing to derive depths conducted with
    the ENVI 4.8 software program while data editing and integration was performed using
    ArcGIS 10. This data set is for the shelf environment of Rota Island, Mariana.",nt"license_title":
